sys_variable_value.value:
(function execute(inputs, outputs) {

  if (inputs.writeusers) 
  {
	if (inputs.twritegrpss)
    {
    	outputs.twritegrp = inputs.twritegrpss;
    }
      else if(inputs.taskshare_writegrp)
     { outputs.twritegrp=inputs.taskshare_writegrp;

     }
    else
    {
    	outputs.twritegrp = "NA"
    }
    var sysId = inputs.writeusers;
	var Addwuser_id = '';
    var Wusers = inputs.Number.variables.Read_Write_Access.toString();
    gs.info('len' + Wusers);
    var split = Wusers.split(',');
    var length = split.length;
    gs.info('length' + length);

	if((length == 1) || (length == 32))
	{
		var id = sysId.user_name.getDisplayValue();
        Addwuser_id += ( id);
	}
	else
	{
		while(sysId.next())
		{
			var id = sysId.user_name.getDisplayValue();
			Addwuser_id += ( id +  ',');
		}
	}
    var wuserids1 = Addwuser_id.trim().replace(/,{1,}$/, '');
	outputs.wuserids = wuserids1;
}	
else
{
	gs.info('No write users');
}

//////Read Access ///////
if (inputs.readusers) 
{
	if (inputs.treadgrpss)
    {
    	outputs.treadgrp = inputs.treadgrpss;
    }
  else if(inputs.taskshare_readgrp)
     { outputs.treadgrp=inputs.taskshare_readgrp;

     }
    else
    {
    	outputs.treadgrp = "NA"
    }

	var RsysId = inputs.readusers;
	var RAddwuser_id = '';

    var Rusers = inputs.Number.variables.Read_Only_Access.toString();
    gs.info('Rlen' + Rusers);
    var Rsplit = Rusers.split(',');
    var Rlength = Rsplit.length;
    gs.info('length' + Rlength);

	if((Rlength == 1) || (Rlength == 32))
	{
		var Rid = RsysId.user_name.getDisplayValue();
        RAddwuser_id += ( Rid);
	}
	else
	{
		while(RsysId.next())
		{
			var Rid = RsysId.user_name.getDisplayValue();
			RAddwuser_id += ( Rid +  ',');
		}
	}
    var userids1 = RAddwuser_id.trim().replace(/,{1,}$/, '');
	outputs.userids = userids1;
}	
else
{
	gs.info('No Read users');
}

  ///// Revoke users  /////
if (inputs.revreadwusers) 
{
	if (inputs.treadgrpss)
    {
		outputs.trevreadgrp = inputs.treadgrpss;
	}
    else
    {
		outputs.trevreadgrp = "NA"
	}

	var RevsysId = inputs.revreadwusers;
	var RevAddwuser_id = '';

    var Revusers = inputs.Number.variables.people_to_revoke_read_write_access.toString();
    gs.info('Revlen' + Revusers);
    var Revsplit = Revusers.split(',');
    var Revlength = Revsplit.length;
    gs.info('length' + Revlength);

	if((Revlength == 1) || (Revlength == 32))
	{
		var Revid = RevsysId.user_name.getDisplayValue();
        RevAddwuser_id += ( Revid);
	}
	else
	{
		while(RevsysId.next())
		{
			var Revid = RevsysId.user_name.getDisplayValue();
			RevAddwuser_id += ( Revid +  ',');
		}
	}
    var remreaduserids1 = RevAddwuser_id.trim().replace(/,{1,}$/, '');
	outputs.remreaduserids = remreaduserids1;
}	
else
{
	gs.info('No revoke users');
}  
///// Revoke Write access ///////
  var shp = inputs.sharepath;
  gs.info(shp.match(/\\Share not Found/gi));
  if(shp.match(/\\Share not Found/gi))
  {
    //gs.info('test');
    outputs.finalshare = inputs.taskshare;
  }
  else
  {
    //gs.info('test1');
    outputs.finalshare = inputs.sharepath;
  } 

  ////////Write access ///////
  /*
