        }
        var sysId = inputs.writeusers;
		var Addwuser_id = '';
  	    var uniq = sysId.split(',');
        var count12 = uniq.length;
     	for(var q=0;q<count12;q++)
        {
		    var usersys = uniq[q];
			var userrec = new GlideRecord('sys_user');
			userrec.addQuery('sys_id',usersys);
			userrec.addQuery('active',true);
			userrec.query();
			if(userrec.next())
			{
